import React from "react";
import { Link } from "react-router-dom";

// Dropdown komponenta
const DropdownMenu = ({ title, items }) => {
  const [open, setOpen] = React.useState(false);

  return (
    <div
      className="relative"
      onMouseEnter={() => setOpen(true)}
      onMouseLeave={() => setOpen(false)}
    >
      <button className="text-white hover:text-cyan-300 font-medium">
        {title} ▾
      </button>
      {open && (
        <div className="absolute left-0 mt-2 flex flex-col bg-gray-900 border border-white/10 rounded shadow-lg min-w-[180px] z-50">
          {items.map((item, index) =>
            item.to ? (
              <Link
                key={index}
                to={item.to}
                className="px-4 py-2 text-sm text-white hover:bg-gray-700"
              >
                {item.label}
              </Link>
            ) : (
              <span
                key={index}
                className="px-4 py-2 text-sm text-gray-400 cursor-not-allowed"
              >
                {item.label}
              </span>
            )
          )}
        </div>
      )}
    </div>
  );
};

const About = () => {
  return (
    <div className="min-h-screen bg-gray-900 text-white font-sans">
      {/* NAVBAR */}
      <div className="fixed top-0 left-0 w-full bg-black/70 backdrop-blur-lg border-b border-white/10 z-50 px-6 py-3 flex justify-between items-center">
        <div className="flex items-center gap-10">
          {/* Logo */}
          <Link to="/" className="flex items-center gap-4 cursor-pointer">
            <img src="/mindloop_logo.png" alt="MindLoop AI Logo" className="h-16" />
          </Link>

          {/* Meniji */}
          <DropdownMenu
            title="CopyBot"
            items={[
              { to: "/VKCopyBot", label: "VK CopyBot" },
              { to: "/CopyBot", label: "CopyBot Overview" },
            ]}
          />
          <DropdownMenu
            title="AI Assistants"
            items={[
              { to: "/ChatBot", label: "ChatBot" },
              { label: "SaaS Generator (Coming soon)" },
            ]}
          />
          <Link
            to="/about"
            className="text-white hover:text-cyan-300 font-medium"
          >
            About Us
          </Link>
        </div>
      </div>

      {/* CONTENT */}
      <div className="px-6 pt-28 pb-16 max-w-4xl mx-auto">
        <h1 className="text-4xl font-bold text-cyan-400 mb-6">About MindLoop AI</h1>

        <p className="text-lg text-gray-300 leading-relaxed">
          MindLoop AI is a collaborative project born out of a shared passion for artificial intelligence,
          automation, and building real-world applications that solve communication problems.
        </p>

        <p className="mt-6 text-gray-200 font-semibold text-xl">👨‍💻 Team</p>
        <div className="mt-2 space-y-4">
          <div>
            <p className="text-cyan-300 font-medium">Maksim Privavlov – Software Engineer</p>
            <p className="text-sm text-gray-400">
              Maksim is a full-stack developer and systems thinker with a strong background in backend architecture.
              He focuses on building reliable infrastructures and designing scalable software systems for AI-driven platforms.
            </p>
          </div>
          <div>
            <p className="text-cyan-300 font-medium">Dragomir Bozoki – Machine Learning / Deep Learning Engineer</p>
            <p className="text-sm text-gray-400">
              Dragomir brings expertise in computer vision, natural language processing, and neural network design.
              He developed the deep learning models powering our lip-reading engine, chatbots, and intelligent assistants.
            </p>
          </div>
        </div>

        <p className="mt-6 text-gray-200 font-semibold text-xl">🧠 How It Started</p>
        <p className="text-gray-300 leading-relaxed mt-2">
          The idea for MindLoop AI started as an academic project focused on visual speech recognition without audio.
          After months of experimentation, prototyping, and testing, it evolved into a broader initiative to create
          practical AI assistants for real-world use — from chatbots for tourism and e-commerce, to tools like CopyBot
          that automate repetitive tasks.  
        </p>

        <p className="mt-6 text-sm text-gray-500">
          🚀 Built with passion, late-night coding sessions, and endless curiosity.
        </p>
      </div>
    </div>
  );
};

export default About;
